body.script:
((l, d) => {
    if (!window.history.state || !window.history.state.key) {
      let f = Math.random().toString(32).slice(2);
      window.history.replaceState({ key: f }, "");
    }
    try {
      let m = JSON.parse(sessionStorage.getItem(l) || "{}")[d || window.history.state.key];
      typeof m == "number" && window.scrollTo(0, m);
    } catch (f) {
      console.error(f), sessionStorage.removeItem(l);
    }
  })("react-router-scroll-positions", null)
